import React, { Component } from 'react';


class Footer extends Component {
  
  render() {
    
    return (

        <footer className="footer">
                 <cite title="Source Title">2019 Vasiliki Vourliotaki</cite>
      </footer>
            )
        }
}

export default Footer;
